import React from 'react'
import cn from 'classnames'
import { Link } from 'react-router-dom'

import LogoSrc from '../../images/catfitLogo.svg'

const MenuItems = [
    {
        id: 1,
        label: 'Are you a Veterinarian?',
        path: '/vet',
    },
    {
        id: 2,
        label: 'Login',
        path: '/login',
    },
    {
        id: 3,
        label: 'Sign Up',
        path: '/signup',
    }
]

const Header = ({ className }) => {
    return (
        <header id='landingHeader' className={cn('landingNav', className)}>
            <div className='navContainer'>
                <img className="logo" src={LogoSrc} alt="cat.fit logo" />
                <nav>
                    {MenuItems.map(({id, label, path}) => (
                        <span
                            key={id}
                            to={path}
                            className={path === '/signup' ? 'signUpBtn' : 'navLink'}
                        >
                            {label}
                        </span>
                    ))}
                </nav>
            </div>
        </header>
    )
}

export default Header
